                    "Issues types allow you to classify and manage your issues with a shared and consistent language across all repositories in an organization, such as bugs or tasks.": "이슈 유형을 사용하면 버그나 작업과 같은 조직 내 모든 저장소에서 공유되고 일관된 언어로 이슈를 분류하고 관리할 수 있습니다.",
