            "Manage cookie preferences": "쿠키 환경설정 관리",
            "Most GitHub websites use cookies. Cookies are small text files placed on your device to store data so web servers can use it later. GitHub and our third-party partners use cookies to remember your preferences and settings, help you sign in, show you personalized ads, and analyze how well our websites are working. For more info, see the Cookies and similar technologies section of the": "대부분의 GitHub 웹사이트는 쿠키를 사용합니다. 쿠키는 웹 서버가 나중에 사용할 수 있도록 데이터를 저장하기 위해 장치에 배치된 작은 텍스트 파일입니다. GitHub와 타사 파트너는 쿠키를 사용하여 사용자의 선호도와 설정을 기억하고, 로그인을 돕고, 개인화된 광고를 표시하며, 웹사이트가 얼마나 잘 작동하는지 분석합니다. 자세한 내용은 쿠키 및 유사 기술 섹션을 참조하십시오",
            "Privacy Statement": "개인정보 보호정책",
            "Accept": "수락",
            "Reject": "거부",
            "Reset all": "모두 재설정",
            "Save changes": "변경 사항 저장",
            "Required": "필수의",
            "GitHub uses required cookies to perform essential website functions and to provide the services. For example, cookies are used to log you in, save your language preferences, provide a shopping cart experience, improve performance, route traffic between web servers, detect the size of your screen, determine page load times, improve user experience, and for audience measurement. These cookies are necessary for our websites to work.": "GitHub는 필수적인 웹사이트 기능을 수행하고 서비스를 제공하기 위해 필요한 쿠키를 사용합니다. 예를 들어, 쿠키는 로그인, 언어 환경설정 저장, 장바구니 경험 제공, 성능 향상, 웹 서버 간 트래픽 라우팅, 화면 크기 감지, 페이지 로드 시간 결정, 사용자 경험 향상, 그리고 청중 측정에 사용됩니다. 이 쿠키들은 우리 웹사이트가 작동하는 데 필요합니다.",
            "Analytics": "분석",
            "We allow third parties to use analytics cookies to understand how you use our websites so we can make them better. For example, cookies are used to gather information about the pages you visit and how many clicks you need to accomplish a task. We also use some analytics cookies to provide personalized advertising.": "저희는 제3자가 귀하의 웹사이트 사용 방식을 이해하기 위해 분석 쿠키를 사용할 수 있도록 허용합니다. 예를 들어, 쿠키는 방문하는 페이지와 작업을 완료하는 데 필요한 클릭 수에 대한 정보를 수집하는 데 사용됩니다. 저희는 또한 개인 맞춤형 광고를 제공하기 위해 일부 분석 쿠키를 사용합니다.",
            "Social Media": "소셜 미디어",
            "GitHub and third parties use social media cookies to show you ads and content based on your social media profiles and activity on GitHub's websites. This ensures that the ads and content you see on our websites and on social media will better reflect your interests. This also enables third parties to develop and improve their products, which they may use on websites that are not owned or operated by GitHub.": "GitHub 및 타사는 소셜 미디어 쿠키를 사용하여 GitHub 웹사이트의 소셜 미디어 프로필과 활동을 기반으로 광고와 콘텐츠를 표시합니다. 이렇게 하면 웹사이트와 소셜 미디어에서 보는 광고와 콘텐츠가 여러분의 관심사를 더 잘 반영할 수 있습니다. 이를 통해 제3자는 GitHub가 소유하거나 운영하지 않는 웹사이트에서 사용할 수 있는 제품을 개발하고 개선할 수 있습니다.",
            "Advertising": "광고",
            "In addition, GitHub and third parties use advertising cookies to show you new ads based on ads you've already seen. Cookies also track which ads you click or purchases you make after clicking an ad. This is done to show you ads that are more relevant to you and for business purposes with our advertising partners. For example, cookies are used to detect when you click an ad and to show you ads based on your social media interests and website browsing history.": "또한, GitHub와 타사는 광고 쿠키를 사용하여 이미 본 광고를 기반으로 새로운 광고를 보여줍니다. 쿠키는 또한 클릭하거나 광고를 클릭한 후 구매하는 광고를 추적합니다. 이것은 귀하와 저희 광고 파트너와의 비즈니스 목적에 더 적합한 광고를 보여드리기 위한 것입니다. 예를 들어, 쿠키는 광고를 클릭할 때를 감지하고 소셜 미디어 관심사와 웹사이트 검색 기록에 따라 광고를 표시하는 데 사용됩니다.",

